// src/pages/AdminPanel.jsx
import React, { useState, useEffect } from "react";
import axios from "axios";
import "../css/admin.css";

function AdminPanel() {
  const [naziv, setNaziv] = useState("");
  const [data, setData] = useState({ svi: [], preporuke: [], best: [] });

  const fetchData = async () => {
    const res = await axios.get("http://localhost:5000/api/data");
    setData(res.data);
  };

  useEffect(() => {
    fetchData();
  }, []);

  const handleDodajSvi = async () => {
    if (!naziv.trim()) return;
    await axios.post("http://localhost:5000/api/artikal", { naziv });
    setNaziv("");
    fetchData();
  };

  const handleDodajUKategoriju = async (kategorija, proizvod) => {
    try {
      await axios.put(`http://localhost:5000/api/dodaj/${kategorija}`, proizvod);
      fetchData();
    } catch (err) {
      alert(err.response?.data?.error || "Greška.");
    }
  };

  const handleObrisi = async (kategorija, naziv) => {
    await axios.delete(`http://localhost:5000/api/obrisi/${kategorija}/${naziv}`);
    fetchData();
  };

  return (
    <div className="container">
      <div className="left">
        <h1>Admin Panel</h1>

        {/* Dodavanje nove kafe */}
        <div className="form-wrapper">
          <input
            type="text"
            value={naziv}
            placeholder="Unesi naziv kafe"
            onChange={(e) => setNaziv(e.target.value)}
          />
          <button onClick={handleDodajSvi}>Dodaj u Svi</button>
        </div>

        {/* Sekcija za preporuke */}
        <div className="section">
          <h2>Preporuke ({data.preporuke.length}/4)</h2>
          <div className="kafa-list">
            {data.preporuke.map((p, i) => (
              <div className="kafa" key={i}>
                <span>{p.naziv}</span>
                <button onClick={() => handleObrisi("preporuke", p.naziv)}>Obriši</button>
              </div>
            ))}
          </div>
        </div>

        {/* Sekcija za best */}
        <div className="section">
          <h2>Best ({data.best.length}/4)</h2>
          <div className="kafa-list">
            {data.best.map((p, i) => (
              <div className="kafa" key={i}>
                <span>{p.naziv}</span>
                <button onClick={() => handleObrisi("best", p.naziv)}>Obriši</button>
              </div>
            ))}
          </div>
        </div>

        {/* Sekcija za sve kafe */}
        <div className="section">
          <h2>Svi proizvodi</h2>
          <div className="kafa-list">
            {data.svi.map((p, i) => (
              <div className="kafa" key={i}>
                <span>{p.naziv}</span>
                <div className="kafa-buttons">
                  <button
                    onClick={() => handleDodajUKategoriju("preporuke", p)}
                    disabled={data.preporuke.length >= 4}
                  >
                    + Preporuka
                  </button>
                  <button
                    onClick={() => handleDodajUKategoriju("best", p)}
                    disabled={data.best.length >= 4}
                  >
                    + Best
                  </button>
                  <button onClick={() => handleObrisi("svi", p.naziv)}>Obriši</button>
                </div>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Desni dio pozadine */}
      <div className="right" />
    </div>
  );
}

export default AdminPanel;
